import logo from './logo.svg';
import './App.css';
import LoginButton from './components/LoginButton';
import LogoutButton from './components/LogoutButton';
import Profile from './components/Profile';
import Posts from './components/posts';

function App() {
  return (
    <div className="App">
    <LoginButton />
    <br/>
    <LogoutButton />
    <br/>
    <Profile />

    <br />
    <Posts />
    </div>
  );
}

export default App;
